import './ExpensesList';
import Expenseltem from './ExpenseItem';

const ExpensesList = props =>{


return 
(
    <>
    {filteredExpenses.length === 0 ? (
    <p>No expenses found.</p>
  ) : (
    filteredExpenses.map((expense) => (
      <Expenseltem
        key={expense.id}
        date={expense.date}
        title={expense.title}
        amount={expense.amount}
      />
    ))
  )}
    </>

)
    }
export default ExpensesList;
